const appMatch = resolve => {
  import('./match').then(module => {
    resolve(module)
  })
}
const appWebPage = resolve => {
  import('./webPage').then(module => {
    resolve(module)
  })
}

export default [
  {
    name: 'appMatch',
    path: '/app/match',
    component: appMatch,
    meta: {
      title: '',
      nav: false,
      auth: false,
      keepAlive: false
    }
  },
  {
    name: 'appWebPage',
    path: '/app/webPage/:id',
    component: appWebPage,
    meta: {
      title: '',
      nav: false,
      auth: false,
      keepAlive: false
    }
  }
]
